import { Component } from "react";

class Demo8ProductComp extends Component
{
    constructor(props)
    {
        super(props)
    }

    render()
    {
        return (<div style={{border:"2px solid orange", backgroundColor:"lightgoldenrodyellow", width:"200px"}}>
            <h3>Product Data</h3>
            
            Name: {this.props.product.name} <br/>
            Price: {this.props.product.price}
            <br/>
        </div>)
    }

}
export default Demo8ProductComp
